import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import {
  Typography,
  Button,
  IconButton,
  List,
  ListItem,
  ListItemText,
  Box, 
  Paper,
  Alert
} from '@mui/material';
import {
  Menu as MenuIcon,
  ExitToApp as ExitToAppIcon,
  AccountBalanceWallet as AccountBalanceWalletIcon,
  Group as GroupIcon,
  GroupAdd as GroupAddIcon,
  AccountCircle as AccountCircleIcon,
  Rule as RuleIcon,
  HelpOutline as HelpOutlineIcon,
  Security as SecurityIcon,
  Assignment as AssignmentIcon
} from '@mui/icons-material';
import axios from 'axios';
import FooterMenu from '../../pages/Footer.jsx';

const Withdraw = ({ userId }) => {
  const [amount, setAmount] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleWithdraw = async () => {
    // Basic validation for amount
    if (!amount || isNaN(amount) || amount <= 0) {
      setError('Please enter a valid amount');
      setSuccess('');
      return;
    }
    const navigate = useNavigate();
    const [menuOpen, setMenuOpen] = useState(false);

    const toggleMenu = () => setMenuOpen(!menuOpen);
    const logout = () => {
      localStorage.removeItem('authToken');
      navigate('/login');
    };

    try {
      // Sending withdraw request to backend
      const response = await axios.post('/api/withdraw', { userId, amount });

      // Handle success
      setSuccess('Withdraw request created successfully!');
      setError('');
      setAmount('');
    } catch (error) {
      // Handle error
      setError('Failed to create withdraw request. Please try again.');
      setSuccess('');
    }
  };

  return (
    <div>
           {/* Header */}
            <div className={`general-content ${menuOpen ? 'expanded' : ''}`}>
              <div className="header">
                <div className="header-left">
                  <IconButton onClick={toggleMenu}>
                    <MenuIcon />
                  </IconButton>
                </div>
                <div className="header-right">
                  <button className="logout-btn" onClick={logout}>
                    <ExitToAppIcon /> Logout
                  </button>
                </div>
              </div>
            </div>

            {/* Side Menu */}
            <div className={`side-menu ${menuOpen ? 'open' : ''}`}>
              <List>
                {[
                  { text: 'Company Profile', icon: <AccountCircleIcon />, path: '/company-profile' },
                  { text: 'Platform Rules', icon: <RuleIcon />, path: '/platform-rules' },
                  { text: 'Common Problems', icon: <HelpOutlineIcon />, path: '/common-problems' },
                  { text: 'Security Center', icon: <SecurityIcon />, path: '/security-center' },
                  { text: 'Funding Details', icon: <AccountBalanceWalletIcon />, path: '/funding-details' },
                  { text: 'Invite Friends', icon: <GroupAddIcon />, path: '/invite-friends' },
                  { text: 'My Team', icon: <GroupIcon />, path: '/my-team' },
                  { text: 'Quotation Tutorial', icon: <AssignmentIcon />, path: '/quotation-tutorial' }
                ].map((item, index) => (
                  <ListItem button key={index} component={Link} to={item.path} className="menu-item">
                    {item.icon}
                    <ListItemText primary={item.text} />
                  </ListItem>
                ))}
              </List>
            </div>
    <Box 
      sx={{
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center', 
        height: '100vh', 
        padding: 2
      }}
    >
      <Paper 
        elevation={3} 
        sx={{
          width: '100%', 
          maxWidth: 400, 
          padding: 3, 
          textAlign: 'center'
        }}
      >
        <Typography variant="h5" gutterBottom>
          Withdraw Funds
        </Typography>

        {/* Display error or success message */}
        {error && <Alert severity="error" sx={{ marginBottom: 2 }}>{error}</Alert>}
        {success && <Alert severity="success" sx={{ marginBottom: 2 }}>{success}</Alert>}

        <TextField
          label="Enter withdraw amount"
          type="number"
          fullWidth
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
          sx={{ marginBottom: 2 }}
        />

        <Button 
          variant="contained" 
          color="primary" 
          onClick={handleWithdraw}
          fullWidth
        >
          Request Withdrawal
        </Button>
      </Paper>
    </Box>

    {/* Footer Menu */}
    <FooterMenu />
    </div>
  );
};

export default Withdraw;
